import "../Promo/Promo.css";


function Promo() {
  return (
    <div className="student-promo">
      <div className="promo-info">
        <p className="promo-title">Учебный проект студента факультета Веб-разработки.</p>
        <div className="promo-buttons">
          <button className="promo-button">О проекте</button>
          <button className="promo-button">Технологии</button>
          <button className="promo-button">Студент</button>
        </div>
      </div>
    </div>
  );
}
export default Promo
